import React from 'react';
import resume1 from '../img/resume2020img1.jpg';
import resume2 from '../img/resume2020img2.jpg';
import './resume.css';

const Resume = () => {

    return (
       <div className="relative  pt-8   px-8 block text-center resumeBox" >
        <span>
        <p className="inline-block float-left ml-8"> text here </p>
        <div className="inline-block">
        <h1 className="resume mx-auto  text-6xl  h1resume"> Noah Kumar Wotring </h1>
        <h2 className=""> Full-Stack Web Developer </h2>
        </div>
        <p className="inline-block  float-right mr-8">9722 Sibley Cir, Orlando FL 32836 <br />
                                    614-312-0290 <br />
                                    noah13wotring@outlook.com <br />
                                    <a href="www.linkedin.com/in/noahwotring" className="hover:text-blue-400"> Linked In </a>
        </p>
        </span>

        <div> </div>
      </div>
    )
  }


export default Resume;
